import React from "react";
import styled from "styled-components";

// Login Background Part
const LoginRightContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: calc(100% / 2);
  height: 100%;
`;
export const LoginRight = () => {
  return <div>Login Right</div>;
};
